@kaitlancollins Joe knows that when it is time for him to take the office he will. 
No reason for him to stress over a non-issue. 
I know it has been a minute since we had leadership that wasn't chaos and rage tweets, but it wasn't that long ago.

@wouldbefirelord “that’s relieving. thank you, kind sister.” his voice is like the rush of fire, like the burning of coal.

he fills with rage, with anger, with pain. he knows it’s just her, yet he can’t help but take it to heart.

“you know azula, i won’t stoop so low. but this is not weakness.”
